  }

  return (
    <div className="App">
      <header>
        <form action="">
          <label htmlFor="name">Location:</label>
          <input onChange={changeCity} type="text" id="name"></input>
          <button type="submit">Submit</button>
        </form>
      </header>
    </div>
  );
}

export default App;
